import './App.css';
import CreateContact from './components/CreateContact';

function App() {
  return (
    <div className="main-page">
      <h2 className="main-page-title">React Metadata Manager</h2>
      <div>
        <CreateContact />
      </div>
    </div>
  );
}

export default App;
